import React, { useEffect, useState } from 'react';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import CardActions from '@mui/material/CardActions';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';

function Content() {
  const [rawData, setRawData] = useState('');
  const [imageUrls, setImageUrls] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedMedia, setSelectedMedia] = useState(null);

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const dataParam = params.get('data');

    if (dataParam) {
      setRawData(dataParam);
    }
  }, []);

  useEffect(() => {
    try {
      const data = JSON.parse(rawData);
      if (Array.isArray(data)) {
        setImageUrls(data);
        console.log('Datos analizados:', data);
      }
    } catch (error) {
      console.error('Error al analizar datos en bruto:', error);
    }
  }, [rawData]);

  const handleMediaClick = (media) => {
    console.log('Media clickeado:', media.link);
    setSelectedMedia(media);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    console.log('Cuadro de diálogo cerrado.');
    setSelectedMedia(null);
    setOpenDialog(false);
  };

  const mediaData = imageUrls.map(url => {
    return {
      link: url,
      type: url.endsWith('.mp4') ? 'video/mp4' : 'image/jpeg', // Modifica según la extensión del archivo
    };
  });

  return (
    <div>
      {mediaData.length > 0 ? (
        <div>
          <Grid container spacing={2}>
            {mediaData.map((media, index) => (
              <Grid item xs={12} sm={6} md={4} key={index}>
                <Card
                  sx={{
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <CardMedia
                    component="div"
                    sx={{
                      pt: '75%',
                      backgroundColor: '#eaeff1',
                      cursor: 'pointer',
                    }}
                    image={media.link}
                    onClick={() => handleMediaClick(media)}
                  />
                  <CardActions sx={{ backgroundColor: '#eaeff1' }}>
                    <Button size="small">View</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>

          <Dialog open={openDialog} onClose={handleCloseDialog}>
            <DialogContent>
              {selectedMedia && selectedMedia.type && selectedMedia.type.startsWith('video/') ? (
                <video controls style={{ width: '100%', height: 'auto' }}>
                  <source src={selectedMedia.link} type={selectedMedia.type} />
                  Tu navegador no admite la reproducción de videos.
                </video>
              ) : (
                selectedMedia && selectedMedia.type && selectedMedia.type.startsWith('image/') ? (
                  <img src={selectedMedia.link} alt="FullScreen" style={{ width: '100%', height: 'auto' }} />
                ) : null
              )}
            </DialogContent>
          </Dialog>
        </div>
      ) : (
        <p>No hay imágenes o videos para mostrar.</p>
      )}
    </div>
  );
}

export default Content;
